import './App.css';
import {BrowserRouter as Router,Route, BrowserRouter} from 'react-router-dom'
import Login from './components/Login';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Router>
      {/* <Switch> */}
        <Route path='/login'>
        <Login/>
        </Route>
     {/* // </Switch> */}
      </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
